import React from "react";
import Data from "./data";

const List = () => {
    const people = Data;
    return (
        <>
            {people.map((person) => {
                const { id, name, age, image } = person;
                return (
                    <>
                        <div></div>
                        <div key={id}>
                            <h4>{name}</h4>
                            <p>{age} years</p>
                            <img src="{image}" alt="" srcset="" />
                        </div>
                    </>
                );
            })}
        </>
    );
};

export default List;
